script: |
  super -f text -I q2058.spq | sort > q2058.out

inputs:
  - name: q2058.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + ( + col1 ) * + - col0 BETWEEN - col2 AND 74 OR NOT ( - 60 * col1 NOT BETWEEN NULL AND - col0 + col2 );
  - name: tab2

outputs:
  - name: q2058.out
    data: |
      46	51	23
      64	77	40
      75	67	58
